coil','Bài 3.6 Các phương pháp tạo hình cơ bản: Lệnh Coil','Giới thiệu lệnh Coil trong Autodesk Inventor Professonal 2015',48,'',14,0,'1441616833_48.jpg',0,'1441616833_48.mp4','2015-09-07 09:08:18',15,1,5,1,1),(65,'asd','asd','asdzxcad',1,'<p style=\"text-align:justify\"><strong>Mario Balotelli</strong>&nbsp;c&oacute; phải l&agrave; một cầu thủ c&aacute; t&iacute;nh kh&ocirc;ng? Euro 2012 c&aacute;ch đ&acirc;y chưa xa, thi&ecirc;n t&agrave;i của anh mang đội Italia v&agrave;o chung kết, tr&ecirc;n đường đi c&ograve;n loại lu&ocirc;n đội tuyển Đức ở b&aacute;n kết với một c&uacute; đ&uacute;p khiến Manuel Neuer chỉ c&ograve;n biết bất lực. Sau khi ghi b&agrave;n thứ 2, anh ta đứng với tư thế của một... pho tượng, trở th&agrave;nh đề t&agrave;i bất tận cho d&acirc;n chế ảnh tr&ecirc;n mạng.</p>\r\n\r\n<p style=\"text-align:justify\">Balotelli, từ l&uacute;c xuất hiện ở đội một của Inter Milan, to&agrave;n g&acirc;y ra những chuyện đi&ecirc;n rồ bất tận. Đốt ph&aacute;o hoa trong nh&agrave; g&acirc;y hỏa hoạn, lấy cầu thủ trẻ ở Man City l&agrave;m bia ph&oacute;ng phi ti&ecirc;u, choảng nhau với Nigel de Jong, c&atilde;i tay đ&ocirc;i với HLV Roberto Mancini, ghi b&agrave;n v&agrave;o lưới Man United rồi ch&igrave;a ra chiếc &aacute;o l&oacute;t với th&ocirc;ng điệp &quot;Sao l&uacute;c n&agrave;o cũng l&agrave; t&ocirc;i?&quot;.</p>\r\n\r\n<p style=\"text-align:justify\">Mới đ&acirc;y nhất, Balotelli vừa c&oacute; một tuy&ecirc;n bố khiến cho c&aacute;c Madridista muốn ph&aacute;t đi&ecirc;n: &quot;Tr&ecirc;n đời n&agrave;y chỉ c&oacute; Barca l&agrave; c&oacute; 2 s&acirc;n. Nou Camp để thi đấu v&agrave; Bernabeu để l&agrave;m s&acirc;n tập&quot;.</p>\r\n\r\n<p style=\"text-align:center\"><img alt=\"\" src=\"http://24h-static.24hstatic.com/images/2014/share-fb.gif\" style=\"border:0px; height:20px; max-width:400px; width:67px\" />&nbsp;<img alt=\"\" src=\"http://24h-static.24hstatic.com/images/2014/share-gg.gif\" style=\"border:0px; height:20px; max-width:400px; width:67px\" /><img alt=\"Siêu sao “giàu, đẹp trai, đá bóng giỏi”, để làm gì? - 1\" class=\"news-image\" id=\"news-image-id-0\" src=\"http://24h-img.24hstatic.com/upload/3-2015/images/2015-09-07/1441625393-29759.jpg\" style=\"border:0px; max-width:400px\" /></p>\r\n\r\n<p style=\"text-align:center\">Mario Balotelli l&agrave; một&nbsp;c&aacute; t&iacute;nh đặc biệt của nền&nbsp;b&oacute;ng đ&aacute; đương đại</p>\r\n\r\n<p style=\"text-align:justify\">Bấy nhi&ecirc;u đấy kh&ocirc;ng đủ gọi l&agrave; c&aacute; t&iacute;nh với Campbell? Vậy xin mời đến với Zlatan Ibrahimovic. Ng&ocirc;i sao người Thụy Điển ngang t&agrave;ng n&agrave;y đi đến đ&acirc;u, chức v&ocirc; địch quốc gia theo anh đến đ&oacute;.</p>\r\n\r\n<p style=\"text-align:justify\">Ở H&agrave; Lan, Ibrahimovic v&ocirc; địch với Ajax. Ở Serie A, anh l&agrave; cầu thủ duy nhất trong lịch sử gi&agrave;nh Scudetto với cả Inter Milan, AC Milan v&agrave; Juventus. Anh tạt qua T&acirc;y Ban Nha v&ocirc; địch La Liga với Barcelona v&agrave; sau đ&oacute; gi&uacute;p Paris S.G ch&iacute;nh thức th&agrave;nh thế lực của Ligue 1.</p>\r\n',14,0,'1441634210_1.jpg',1,'1441634210_1.mp4','2015-09-07 13:57:06',1,1,1,1,0),(66,'bai-37-cac-phuong-phap-tao-hinh-co-ban','Bài 3.7 Các phương pháp tạo hình cơ bản','Bài tập ứng dụng lệnh Sweep để thiết kế ghế sử dụng trong gia đình',48,'',14,0,'1441685169_48.jpg',0,'1441685169_48.mp4','2015-09-08 04:06:49',27,1,5,1,1),(67,'bai-38-cac-phuong-phap-tao-hinh-co-ban','Bài 3.8 Các phương pháp tạo hình cơ bản','Giới thiệu lệnh Rib và Emboss trong Autodesk Inventor Professional 2015',48,'',14,0,'1441705400_48.jpg',0,'1441705400_48.mp4','2015-09-08 09:44:08',33,1,5,1,1),(68,'bai-4-cac-dac-tinh-lam-viec-work-features','Bài 4.1 Các đặc tính làm việc- Work Features','Điểm làm việc: Work Point, \r\nTrục làm việc: Work Axis, \r\nMặt làm việc: Work Plane.',48,'',14,0,'1441708138_48.jpg',0,'1441708138_48.mp4','2015-09-08 10:29:04',25,1,5,1,1),(69,'bai-42-cac-dac-tinh-lam-viec-work-features','Bài 4.2 